INSERT INTO `global-DEFAULT_COURSE-1-Instances` VALUES (8,'4b9e5b472ef28',1,1,3,'','',NULL,'','',NULL,NULL,NULL,'','Tipps und Tricks Anfrage','Thomas Schedler','thomas.schedler@massiveart.com','Thomas Schedler','thomas.schedler@massiveart.com','','',3,'2010-03-15 16:07:35','2010-04-15 08:06:43'),(9,'4bc5b7f1da58c',1,1,3,'','<p><b>Konstruktion:</b><br /> Implantatprothetik ist die neue Herausforderung f&uuml;r den modernen Zahntechniker. Oftmals ist es weniger das Implantat an sich, sondern vielmehr die Suprakonstruktion, die die gestiegenen Bed&uuml;rfnisse wie z.B. einer kaustabilen Seitenzahnaufstellung befriedigen muss. In derartigen F&auml;llen wird in der Literatur vor allem auf die lingualisierte Aufstellung verwiesen.</p>\n<p><b>Okklusion:</b><br /> Der Workshop vermittelt das lingualisierte Okklusionskonzept in der praktischen Anwendung des SR Phonares&reg;Lingual NHC. Neben der Ber&uuml;cksichtigung funktioneller Anspr&uuml;che einer hochwertigen implantatprothetischen Versorgung, soll auch &auml;sthetischen und phonetischen Kriterien Rechnung getragen werden.</p>\n<p><b>Pr&auml;zision:</b><br /> Das SR Ivocap&reg; Prothesenmaterial-Injektionssystem &uuml;berzeugt seit mehr als 25 Jahren Benutzer in aller Welt durch kontinuierliche, pr&auml;zise Injektion w&auml;hrend der Heisspolimerisation des schlagz&auml;hen SR Ivocap High Impact-Prothesenmaterials. Der Kursteilnehmer kann das Ausschliessen der Bisserh&ouml;hung und die hohe Passgenauigkeit an einem praktischen Fall aus seinem Labor testen. Oder die Probe aufs Exempel an einem zur Verf&uuml;gung gestellten Oberkiefer- oder Unterkiefermodell machen.</p>\n<p><b>Kursinhalt:<br /> \n<ul>\n<li><span style=\"font-weight: normal;\">Vermitteln der theoretischen Grundlagen der Modellanalyse und des lingualisierten Okklusionskonzepts</span></li>\n<li><span style=\"font-weight: normal;\">Umsetzung einer &auml;sthetischen, individuellen und nat&uuml;rlichen Frontzahnaufstellung mit SR Phonares NHC</span></li>\n<li><span style=\"font-weight: normal;\">Lingualisierte Aufstellung mit den SR Phonares Lingual NHC wahlweise im Stratos 100, 200 oder 300</span></li>\n<li><span style=\"font-weight: normal;\">Herstellung einer Prothese (Unterkiefer) mit der bew&auml;hrten Heisspolymerisat-Injektionstechnik SR Ivocap-System</span></li>\n<li><span style=\"font-weight: normal;\">Nat&uuml;rliche, &auml;sthetische Zahnfleischgestaltung (Gingiva) durch Modellieren und Charakterisieren (einf&auml;rben)</span></li>\n</ul>\n</b></p>\n<p><span style=\"font-weight: bold;\">Kursziel:<br /><span style=\"font-weight: normal;\">Interessierte Prothetiker/-innen und Zahntechniker/-innen erfahren die Vorteile der lingualisierten Okklusion f&uuml;r die Implantatprothetik in Theorie und Praxis. Durch das praktische Umsetzen einer Prothese in Kunststoff k&ouml;nnen sie sich von der Pr&auml;zision und Qualit&auml;t der bew&auml;hrten Heisspolymerisat-Injektionstechnik des SR Ivocap-Systems &uuml;berzeugen.</span></span></p>',NULL,'','',NULL,NULL,NULL,'','Kursanfrage','Thomas Schedler','thomas.schedler@massiveart.com','Thomas Schedler','thomas.schedler@massiveart.com','','5',3,'2010-04-14 12:41:21','2010-04-15 12:42:21');
