INSERT INTO `global-DEFAULT_PRESS-1-Instances` VALUES (3,'4b99213f386f5',1,1,3,'','',NULL,'','','','','','',NULL,0,3,'2010-03-11 17:29:35','2010-03-11 17:34:24'),(5,'4b99301c199fc',1,1,3,'','',NULL,'','','','','','',NULL,0,3,'2010-03-11 18:11:24','2010-03-11 18:13:25'),(6,'4b99fc7f1e684',1,1,3,'','<p><strong>Der Programat P500 der zweiten Generation von Ivoclar Vivadent</strong><br /><br />Der Programat P500/G2&nbsp; pr&auml;sentiert sich mit einem neuen Farb-Touch-Display und mehreren neuen Features, die die Qualit&auml;t der Brennergebnisse positiv beeinflussen. Diese zweite Generation des Ofens baut auf den Eigenschaften des Vorg&auml;nger-Modells auf.</p>\n<p>Ivoclar Vivadent hat die zweite Generation des Keramikbrennofens Programat P500 mit einem Farb-Touch-Display entwickelt. Die Benutzeroberfl&auml;che des Displays zeichnet sich durch &uuml;bersichtliche Icons aus. Diese Oberfl&auml;che erm&ouml;glicht es, Daten einfach und bequem einzugeben und relevante Parameter schnell abzulesen. Dabei informiert die farbige Brennkurve bzw. die grosse Restzeitanzeige mit dem farbigen Fortschrittsbalken den Anwender &uuml;ber den aktuellen Prozess-Status.</p>\n<p><strong>Zahlreiche neue Features</strong><strong><br /> </strong>Zu den weiteren Produktvorteilen z&auml;hlen die &bdquo;Cooling Shock Protection&ldquo; (CSP), die durch einen speziellen &Ouml;ffnungsprozess Restspannungen in der Keramik reduziert. Die \"Thermo Shock Protection\" (TSP) verhindert dagegen einen thermischen Schock der Keramik, wenn der Ofenkopf bei zu heisser Temperatur geschlossen wird. Die moderne Stromspar-Technologie (Power Saving Technology) reduziert den Energieverbrauch im Standby-Modus um bis zu 40 Prozent. Das wirkt sich positiv auf die Energiekosten aus und schont die Umwelt.</p>\n<p><strong> Baut auf Bew&auml;hrtem auf </strong><br />Neben all diesen Neuerungen besticht der Programat P500 weiterhin durch seine bew&auml;hrten Produktmerkmale. Dazu z&auml;hlen die Quarzrohr-Heizmuffeltechnologie, die automatische Doppelbereichskalibration, USB-Anschl&uuml;sse sowie die Kombination von Folientastatur und Touch Display.</p>\n<p>Der Programat P500 der zweiten Generation ist ab M&auml;rz 2010 erh&auml;ltlich.</p>',NULL,'Hochauflösende Bilder','Dokumente','','','','','Pressebilder',5,3,'2010-03-12 08:34:07','2010-04-08 15:13:26'),(7,'4b9e39154d52c',1,1,3,'','<h2>Ivoclar Vivadent stellt das Implant Care-Programm vor</h2>\n<p>Bei Implant Care von Ivoclar Vivadent handelt es sich um ein Programm, das aus aufeinander abgestimmten Produkten besteht. Es bietet Implantatversorgungen einen umfassenden Schutz.</p>\n<p>Mit Implant Care pr&auml;sentiert Ivoclar Vivadent ein Produkt-Programm, um Patienten w&auml;hrend der verschiedenen Phasen der Implantatbehandlung und der lebenslangen Nachsorge professionell zu betreuen. Dieses Programm wird den Anforderungen gerecht, die komplexe Strukturen von Versorgungen und individuelle Voraussetzungen im Mund an den Zahnarzt stellen. Implant Care umfasst eine Reihe aufeinander abgestimmter Produkte. Dazu geh&ouml;ren die Indikatorfl&uuml;ssigkeit &bdquo;Plaque Test&ldquo;, die Prophy-Paste mit RDA 7 &bdquo;Proxyt&ldquo;, der Schutzlack mit Chlorhexidin &bdquo;Cervitec Plus&ldquo;, das Mundpflege-Gel mit Chlorhexidin und Fluorid &bdquo;Cervitec Gel&ldquo; sowie der Lippen-Wangenhalter &bdquo;OptraGate&ldquo;. Alle diese Produkte f&uuml;r die professionelle Reinigung und Keimkontrolle sch&uuml;tzen und schonen das empfindliche periimplant&auml;re Gewebe. Damit erhalten anspruchsvolle Suprastrukturen, festsitzender oder abnehmbarer Zahnersatz sowie nat&uuml;rliche Z&auml;hne eine optimale Pflege &ndash; hinsichtlich Funktion und &Auml;sthetik.</p>\n<p>Ein spezielles Implant Care-Kit ist ab sofort erh&auml;ltlich.</p>\n<p>Abb. 1: Implant Care: Das Mundgesundheits-Management bei Implantat-Patienten</p>',NULL,'','',NULL,NULL,NULL,'',NULL,5,3,'2010-03-15 13:41:41','2010-04-08 14:05:03'),(8,'4b99fc7f1e684',1,2,3,'','',NULL,'','',NULL,NULL,NULL,'',NULL,0,3,'2010-03-17 16:31:20','2010-03-17 16:44:45'),(9,'4b99fc7f1e684',1,3,3,'','',NULL,'','',NULL,NULL,NULL,'',NULL,0,3,'2010-03-17 16:48:07','2010-03-17 16:49:38'),(10,'4b99fc7f1e684',1,19,3,'','',NULL,'','',NULL,NULL,NULL,'',NULL,0,3,'2010-03-17 17:04:27','2010-03-17 17:04:27');
