INSERT INTO `page-DEFAULT_FORM-1-Instances` VALUES (1,'4b55857146c18',1,1,2,'','<p>Iam conjuratio, regno re oro Aveho curiositas cicuta, dis Occulte, deprecativus typus caterva pauci, his re supermitto. Ruo in divortium ita sesquimellesimus Oppono plus celo sceptrum, res ingustatus hi Ango prae tum quatenus/quatinus Sumptus per Avoco nos Indulgens mei heu cur Baiulus attonitus. Via subterfugio radio hac castra, tui Seorsum tam Byssus ex infirmitas. Cum illi organum archidictus,.</p>',NULL,'Unsere Bilder','Dokumente','Verwandte Seiten','Videos','','','Kontaktanfrage','Ivoclar Vivadent AG','info@ivoclarvivadent.com','Cornelius H','cha@massiveart.com','','',2,'2010-04-02 12:06:38','2010-04-19 07:44:13'),(2,'4b55857146c18',1,2,3,'','',NULL,'','','','','','','','Ivoclar Vivadent AG','info@ivoclarvivadent.com','Cornelius Hansjakob','cha@massiveart.com','','',2,'2010-04-02 13:24:51','2010-04-22 09:09:01'),(3,'4bbd7bd801751',1,1,2,'','<p>We offer an excellent opportunity for a dental professional to provide technical support and training on removable products to our dental laboratory customers in the Midwest territory.  The successful candidate will reside within the territory.  Qualified candidates should attach MS Word formatted resume when applying.  Ivoclar Vivadent, Inc. is an Equal Opportunity Employer.</p>\n<p><strong>Task</strong></p>\n<ul>\n<li>Provide technical services on removable products to customers and sales force. </li>\n<li>Provide in-field training and/or follow up to customers. </li>\n<li>Present products and demonstrate materials at field seminars, clinics, trade shows and meetings.  Travel to customer/trade show locations when necessary. </li>\n<li>Provide demonstrations and lectures to customers and sales representatives on new products. </li>\n<li>Understand processes of competitive systems in order to communicate product development needs or changes to Ivoclar Vivadent systems. </li>\n<li>Contribute to the sales growth of the Technical or Clinical Sales Group. </li>\n</ul>\n<p><strong>Requirements</strong></p>\n<ul>\n<li>CDT, MDT, RDT, DDS, DMD or other professional diploma in dentistry, i.e. (R.D.H.) is strongly recommended but not mandatory. </li>\n<li>Previous experience and knowledge of dental prosthetic products. </li>\n<li>Proven sales, teaching and problem solving abilities. </li>\n<li>Attention to detail, organizational and interpersonal skills. </li>\n<li>Ability to travel. </li>\n</ul>\n<p><strong>Perspectives</strong></p>\n<ul>\n<li>Competitive compensation </li>\n<li>Weekly expense reimbursement </li>\n<li>Opportunity for Advancement Medical and Dental Benefits </li>\n<li>Other Voluntary Benefit Options </li>\n<li>Flexible Spending Accounts </li>\n<li>Life and Disability Insurance </li>\n<li>Competitive Time Off Program </li>\n<li>401(k) and Pension Plan </li>\n<li>Employee Child Scholarship Program </li>\n<li>Corporate Wellness Programs and On-Site Fitness Room </li>\n<li>Potential for International Training</li>\n<li>Training Positive, Upbeat Work Environment</li>\n</ul>',NULL,'','Detail','Weitere Angebote','','','','Jobbewerbung: Webmaster','Ivoclar Vivadent AG','info@ivoclarvivadent.com','Cornelius JOB','cha@massiveart.com','<p>Vielen Dank f&uuml;r Ihr Interesse an diesem Job.<br />Wir werden uns in K&uuml;rze mit ihnen in Verbindung setzen.</p>','5',2,'2010-04-08 06:46:51','2010-04-08 12:10:57');
/*!40000 ALTER TABLE `page-DEFAULT_FORM-1-Instances` ENABLE KEYS */;
