INSERT INTO `page-DEFAULT_PAGE_1-1-Instances` VALUES (1,'4b4d8dc9a138f',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 09:09:29','2010-01-13 09:09:29'),(2,'4b4da15087430',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 10:32:48','2010-03-23 09:43:55'),(3,'4b4da26279384',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 10:37:22','2010-01-13 10:37:22'),(4,'4b4da2f3f290d',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 10:39:48','2010-03-23 12:59:35'),(5,'4b4da3e1c4291',1,1,3,'Willkommen auf der Internetseite der Ivoclar Vivadent','<p>Das Internet ist zu einem wichtigen Informations- und Kommunikationsmedium im dentalen Bereich avanciert.&nbsp; Immer h&auml;ufiger nutzen Zahn&auml;rzte und Zahntechniker dieses Medium zur Beschaffung von Produktinformationen und zur Fortbildung. Mit der zunehmenden Nutzung ist auch der Bedarf nach einer Optimierung der Webseite gestiegen, um diese Ihren W&uuml;nschen und Bed&uuml;rfnissen entsprechend zu gestalten. Ihre Bed&uuml;rfnisse und die sich uns bietenden Kommunikationsm&ouml;glichkeiten haben uns dazu veranlasst, unsere Internet-Plattform weiter zu verbessern. Ich habe nun das Vergn&uuml;gen, Sie auf der Informations-Homepage der Ivoclar Vivadent AG willkommen zu heissen und Ihnen einen kurzen &Uuml;berblick zu bieten.<br /><br />Bei der Weiterentwicklung bzw. Neukonzeption stand der Online-Besucher -also Sie - im Mittelpunkt der &Uuml;berlegungen. Erste Priorit&auml;t war immer die Benutzerfreundlichkeit unserer Homepage - und sollte dies auch bleiben. In der Entwicklungs- und Planungsphase erhielten wir viele wertvolle Anregungen von Benutzern, die auch in die Konzeption einflossen. Unser Internetauftritt ist daher besonders benutzerfreundlich, da er durch Benutzer mitgestaltet wurde.<br /><br />Gebrauchsinformationen, wissenschaftliche Dokumentationen, Brosch&uuml;ren, Bilder, Videos und Sicherheitsdatenbl&auml;tter f&uuml;r viele Produkte lassen sich einfach und schnell herunterladen. Als JournalistIn finden Sie im&nbsp; Presseraum alle Pressemeldungen der letzten drei Jahre, sowie ein umfangreiches Bildarchiv. Die Sparte Medienresonanz bietet Ihnen einen &Uuml;berblick &uuml;ber publizierte Artikel rund um Ivoclar Vivadent.&nbsp; Seit&nbsp;Mai 2006 ist die deutsche und englische Version der Homepage aktiv, und im Laufe der n&auml;chsten Monate werden auch die italienischen, franz&ouml;sischen und spanischen Internetportale ge&ouml;ffnet.<br /><br />Wir hoffen, dass Ihnen der Besuch auf unserer Homepage Vergn&uuml;gen bereiten wird. Besuchen Sie unsere Webseite so oft wie m&ouml;glich und nutzen Sie die Informationsm&ouml;glichkeiten, die sie Ihnen bietet! Bitte haben Sie Verst&auml;ndnis daf&uuml;r, dass unsere Arbeit an der Homepage weitergehen wird - wir tun dies zu Ihrem Wohle und um dieses Kommunikations-<br />medium weiter zu verbessern. Bitte senden Sie uns weiterhin Ihre Ideen und Ihr Feedback. Bei Ivoclar Vivadent sind wir stets bem&uuml;ht, Ihnen umfassende Informationen sowie Dentalmaterialien h&ouml;chster Qualit&auml;t und &Auml;sthetik zur Verf&uuml;gung zu stellen.<br /><br />Nochmals willkommen auf der Internetseite der Ivoclar Vivadent!<br /><br />Robert A. Ganley / CEO</p>',NULL,'','','weiter Informationen (Test Michi)','','','','',3,'2010-01-13 10:43:45','2010-04-13 08:49:20'),(6,'4b4da3ee0b54d',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 10:43:58','2010-03-25 13:55:39'),(7,'4b4da40da918b',1,1,2,'','',NULL,'','','','','','','',3,'2010-01-13 10:44:29','2010-03-23 13:47:18'),(8,'4b4da41b05a85',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 10:44:43','2010-03-12 13:34:30'),(9,'4b4da430b62f8',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 10:45:04','2010-01-18 13:02:21'),(10,'4b4da6aa1ac18',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 10:55:38','2010-03-12 13:34:16'),(11,'4b4da6bdeafc1',1,1,3,'','',NULL,'','','','','','','',3,'2010-01-13 10:55:57','2010-03-12 13:34:53'),(12,'4b4da6c8b5347',1,1,3,'','',NULL,'','','','','','','',3,